import React from 'react';
import { Typography } from '@material-ui/core';
import Background from 'https://images.pexels.com/photos/443383/pexels-photo-443383.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500'

class HomePage extends React.Component {
    
    render(){
        return(
            <div img = 'https://images.pexels.com/photos/443383/pexels-photo-443383.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500'>

                <div margin = '20rem' align = 'left'>
                    
                </div>
                <div align= "right">
                    <Typography >
                        Welcome
                    </Typography>
                </div>
            </div>

        )
    }

}
export default HomePage;
